#include <string>#include <vector>using namespace std;vector<vector<int>> solution(vector<vector<int>> arr1, vector<vector<int>> arr2) {    int n = arr1.size(), m = arr1[0].size(), k = arr2[0].size();    vector<vector<int>> answer(n, vector<int>(k));        for(int a = 0; a < n; a++){        for(int b = 0; b < k; b++){            answer[a][b] = 0;            for(int c = 0; c < m; c++){                answer[a][b]+=arr1[a][c]*arr2[c][b];            }        }    }    return answer;}